import React, { useEffect, useState } from 'react';
import {
  TextField,
  Button,
  MenuItem,
  Box,
  Typography,
  Paper,
  Grid,
} from '@mui/material';
import { TimePicker, LocalizationProvider } from '@mui/x-date-pickers';
import { AdapterDateFns } from '@mui/x-date-pickers/AdapterDateFns';

function CustomerPage() {
  const [customers, setCustomers] = useState([]);
  const [name, setName] = useState('');
  const [appointment, setAppointment] = useState(null);
  const [barber, setBarber] = useState('');

  useEffect(() => {
    fetchCustomers();
  }, []);

  const fetchCustomers = () => {
    fetch('http://localhost:5000/api/customers')
      .then(response => response.json())
      .then(data => setCustomers(data))
      .catch(error => console.error('Error fetching customers:', error));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!appointment) return;

    const formattedTime = appointment.toLocaleTimeString([], {
      hour: '2-digit',
      minute: '2-digit',
    });

    const newCustomer = { name, appointment: formattedTime, barber };

    fetch('http://localhost:5000/api/customers', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newCustomer),
    })
      .then(() => {
        fetchCustomers();
        setName('');
        setAppointment(null);
        setBarber('');
      })
      .catch(err => console.error('Error:', err));
  };

  const handleDelete = (id) => {
    fetch(`http://localhost:5000/api/customers/${id}`, {
      method: 'DELETE',
    })
      .then(() => fetchCustomers())
      .catch(err => console.error('Error deleting customer:', err));
  };

  const grouped = customers.reduce((acc, curr) => {
    acc[curr.barber] = acc[curr.barber] || [];
    acc[curr.barber].push(curr);
    return acc;
  }, {});

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom>
        Customer Appointment Booking
      </Typography>

      <Paper sx={{ p: 3, mb: 4 }}>
        <form onSubmit={handleSubmit}>
          <Grid container spacing={2} alignItems="center">
            <Grid item xs={12} sm={3}>
              <TextField
                fullWidth
                label="Name"
                value={name}
                required
                onChange={(e) => setName(e.target.value)}
              />
            </Grid>

            <Grid item xs={12} sm={3}>
              <LocalizationProvider dateAdapter={AdapterDateFns}>
                <TimePicker
                  label="Appointment Time"
                  value={appointment}
                  onChange={(newValue) => setAppointment(newValue)}
                  renderInput={(params) => <TextField fullWidth required {...params} />}
                />
              </LocalizationProvider>
            </Grid>

            <Grid item xs={12} sm={3}>
              <TextField
                select
                label="Barber"
                fullWidth
                value={barber}
                required
                onChange={(e) => setBarber(e.target.value)}
              >
                <MenuItem value="Raj">Raj</MenuItem>
                <MenuItem value="Aman">Aman</MenuItem>
                <MenuItem value="Sana">Sana</MenuItem>
              </TextField>
            </Grid>

            <Grid item xs={12} sm={3}>
              <Button type="submit" variant="contained" fullWidth>
                Book
              </Button>
            </Grid>
          </Grid>
        </form>
      </Paper>

      <Typography variant="h5" gutterBottom>
        Current Queue
      </Typography>

      {Object.keys(grouped).map((barberName) => (
        <Box key={barberName} mb={3}>
          <Typography variant="h6">{barberName}'s Queue</Typography>
          <ul>
            {grouped[barberName].map((customer) => (
              <li key={customer.id}>
                {customer.name} — {customer.appointment}
                <Button
                  size="small"
                  onClick={() => handleDelete(customer.id)}
                  sx={{ ml: 2 }}
                >
                  Done
                </Button>
              </li>
            ))}
          </ul>
        </Box>
      ))}
    </Box>
  );
}

export default CustomerPage;
